import "./App.css";
import { useEffect, useState } from "react";
export const Gif = ({ title, id, url }) => {


  const [gifs, setGifs] = useState([])

  useEffect(function () {
    getGifts({keyword : 'dogge'}).then(gifs =>
    setGifs(gifs)
    )
  }, [])


  return (
    <div>
      <h4>{title}</h4>
      <small>{id}</small>
      <img alt={title} src={url} />
    </div>
  );
};
